INSERT INTO "smsTemplate" VALUES (1, 'This is to inform you that your ward <%name%>  of class <%class%>  is not present in school today. We hope all is well', 'Absentee', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (2, 'Kindly donate old clothes, stationery items,toys,books etc towards donation for underprivileged children. We look forward for your whole hearted co-operation', 'Donation', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (3, 'Your ward <%name%> of class <%class%> is required to appear for a retest in <%text_subject_name%> on <%text_date%>', 'Retest', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (4, 'Your ward <%name%> of class <%class%> was misbehaving in the school bus. Please counsel him/her not to repeat this.', 'Misbehave', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (5, 'Your ward <%name%> of class <%class%> was late in reaching school today. Please ensure that it is not repeated in future', 'Late', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (6, 'Your ward <%name%> of class <%class%> has not returned the library book issued to him. Please ensure that he/she returns it on the next working day, positively', 'LibraryBook', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (7, 'Your ward <%name%> of class <%class%> has to stay back after school for <%text_reason%>. Please pick up your ward from school at <%text_time%>. In case your ward has to be allowed to go home on his/her own,please send a proper application signed by you for the same', 'Stay Back Information:', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (8, 'This is to inform you that your ward <%name%> of class <%class%> did not attend the <%text_subject_name%> class in the <%text_period%> period. You are requested to meet the Vice Principal/Educational Supervisor/Class Teacher in this connection on <%text_date%> at <%text_time%>', 'BUNKING CLASSES', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (9, 'Your ward''s worksheets are being sent home for your perusal and appraisal', 'Worksheets', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (10, 'We are glad to inform you that your ward has settled well during the current academic year and is doing well. We hope to continue receiving your whole-hearted co-operation for your ward''s all round development', 'Well Being', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (11, 'Entries are invited from all the students for the school magazine. Students should submit their entries to their class teachers/English Teachers/Student Editors', 'Magzine', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (12, 'Please note that there will be a class photo for classes <%class%> on <%text_date%>', 'ClassPhoto', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (13, 'Kindly ensure that your ward <%name%> of class <%class%> brings his/her books according to the time table', 'TimeTable', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (14, 'Congratulations Your ward <%name%> of class <%class%> has won the <%text_prize%> Prize in the <%text_event%> event held on <%text_date%> We wish him/her all the best for the future', 'Prize Distribution', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (15, 'An Art competition for classes <%class%> will be held on <%text_date%> Please send all the required material and colours.', 'Art Competition', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (16, 'Your ward <%name%> of class <%class%> has taken home his/her art file without permission. Please send it back on the next working day positively.', 'File Return', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (17, 'Your ward <%name%> of class <%class%> has not brought his/her colours and/or art file today.', 'Art Material Irregular', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (18, 'You are requested to meet the Class Teacher <%text_teacher_name%> on <%text_date%> at <%text_time%> to discuss about preparation for upcoming competition/activity', 'Competition Preparation', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (19, 'You are requested to meet the Vice Principal/Educational Supervisor/Class Teacher/Subject teacher/Guidance Counsellor <%text_teacher_name%> on <%text_date%> at <%text_time%> to discuss about the progress of your ward.', 'Special Meeting', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (20, 'It has been observed that in spite of repeated reminders,your ward <%name%> of class <%class%> has not been coming in proper school uniform. Please ensure that he/she does not repeat the same in future', 'Irregular Uniform', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (21, 'This is to inform you that <%text_activity%> for class <%text_class%> will be held on <%text_date%> Please ensure that your ward brings the required material', 'Upcoming Activity', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
INSERT INTO "smsTemplate" VALUES (22, 'You are cordially invited for the <%text_event%> on <%text_date%> at <%text_venue%> from <%text_time%> onwards', 'Invitation', 1, '2013-03-30 08:28:06', '2013-03-30 08:28:06');
